нравятся или по размеру такие не захочу, но на самом деле я в восторге. Очень красивые, пусть с гранью, но их это не портит, по размеру, как и заявлено 30мм-средний размер, само то)", "2017-03-19T16:41:27+03:00", "серебристый", "0", 8, 3, 5, "Серьги", "SOKOLOV"], "243": ["Отличные серьги, за 600 р идеальный вариант!", "2017-01-24T14:45:56+03:00", "серебристый", "0", 3, 0, 5, "Серьги", "SOKOLOV"], "244": ["Отличные серьги,не тонкие, не гнуться, замок крепко входит,на ушах-невесомые.На фото не видно,но торец сделан крупными гранями,сначала удивилась,заказывала же плоские, но на самом деле выглядят лучше!!!", "2016-11-15T13:18:22+03:00", "серебристый", "0", 8, 0, 5, "Серьги", "SOKOLOV"], "245": ["Отличные серь, рекомендую", "2016-11-13T08:53:33+03:00", "серебристый", "0", 0, 1, 5, "Серьги", "SOKOLOV"], "246": ["Серьги пришли отличные. Оделись хорошо, мочку не царапают. Замочки хорошие. Приобретением довольна.", "2016-10-13T13:12:06+03:00", "серебристый", "0", 2, 0, 5, "Серьги", "SOKOLOV"], "247": ["Отличные серьги! Тонкие, легкие и заметные. Ношу две недели не снимая. Даже сплю в них - форма не теряется. С замками проблем нет.  В общем, осталась довольна.", "2016-07-25T09:43:12+03:00", "серебристый", "0", 9, 0, 5, "Серьги", "SOKOLOV"], "248": ["Отличный вариант, серьги ни маленькие, ни большие, то что хотела!", "2016-04-25T16:29:36+03:00", "серебристый", "0", 5, 0, 5, "Серьги", "SOKOLOV"], "249": ["Уже покупала такие серьги для себя-понравились были без изъянов.В этот раз заказала для подруги.Привезли такие же,но с неисправными замками.Открыть,закрыть-заедают,развести в стороны сложно.Видно что на этой серьге штырек длинее на 2мм,чем на другой.Будет обидно если брак не признают.", "2016-03-22T18:45:28+03:00", "серебристый", "0", 6, 0, 2, "Серьги", "SOKOLOV"], "250": ["Люблю серьги \"Конго\", у меня их много, разного диаметра и с разными насечками. Эти - достойное пополнение моей коллекции))) Надеваются и застёгиваются без проблем. Достаточно крупные, чтобы привлекать внимание, но не огромные, вполне годятся как повседневные. Достались за 520 р., очень довольна.", "2016-03-01T23:00:54+03:00", "серебристый", "0", 18, 1, 5, "Серьги", "SOKOLOV"], "251": ["Очень понравились брала ребенку 14 лет", "2016-01-24T07:52:39+03:00", "серебристый", "0", 3, 4, 5, "Серьги", "SOKOLOV"], "252": ["Вместо этих серёжек положили другие.нехорошо.", "2016-01-22T23:58:51+03:00", "серебристый", "0", 4, 4, 1, "Серьги", "SOKOLOV"], "253": ["Очень хорошие колечки, для тех кто носит  такие серьги всем хороши.", "2016-01-03T16:27:24+03:00", "серебристый", "0", 2, 1, 5, "Серьги", "SOKOLOV"], "254": ["Славные сережки, одеваются и застегиваются легко, мне понравились.", "2015-12-01T07:43:11+03:00", "серебристый", "0", 4, 0, 5, "Серьги", "SOKOLOV"], "255": ["Серьги отличные!!!Очень удобные, легкие, смотрятся женственно,одеваются легко, не хлипкие, пару часов в них поспала, форму не потеряли и не помялись,как часто бывает с серебром у меня.Достались чуть больше чем за 500р, спасибо WB!", "2015-11-24T01:13:56+03:00", "серебристый", "0", 7, 0, 5, "Серьги", "SOKOLOV"], "256": ["Ой как сильно понравились.Насечка у меня другая не такая как на фото Людмилы.\r\nКупила дочке,она мечтала о таких.\r\nЗамочек хорошенький.", "2015-11-21T13:20:32+03:00", "серебристый", "0", 5, 0, 5, "Серьги", "SOKOLOV"], "257": ["Отличные сережки", "2015-11-04T14:55:26+03:00", "серебристый", "0", 0, 2, 5, "Серьги", "SOKOLOV"], "258": ["замечательные серьги, я в восторге, как раз то что искала.", "2015-09-18T19:21:08+03:00", "серебристый", "0", 0, 1, 5, "Серьги", "SOKOLOV"], "259": ["Серьги  невозможно одеть! Та часть, которая продевается в ухо, имеет острый срез, как будто ножом отрезано. Острые края царапают кожу! Так и не удалось одеть померить. Такого кустарного выполнения не ожидала. Фирма SOKOLOV очень разочаровала. Однозначно отказ!!", "2015-08-27T16:19:39+03:00", "серебристый", "0", 5, 8, 1, "Серьги", "SOKOLOV"], "260": ["Серьги очень красивые,нежные,легкие.Замочек крепкий, удобный.Средний размер, на каждый день отлично. Советую.", "2015-07-06T22:18:37+03:00", "серебристый", "", 11, 0, 5, "Серьги", "SOKOLOV"]}
